import React from 'react';
import {Link} from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';

function Pagination( {props} ){

  const dispatch = useDispatch();
  const pagination = useSelector(state => state.baths.currentPage);

  const nextPage = (p_index, index) => {
    dispatch({type: 'NEXT_PAGE', page: 10 });
  }

  // const pervPage = (p_index, index) => {
  //   dispatch({type: 'NEXT_PAGE', page: 10 });
  // }

	return(
		<div className="pagination">
      <ul className="pagination-container">
        <li><a href="#" className="item item-prev"><svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M10 3L5 8L10 13" stroke="black" strokeWidth="1.6" strokeLinecap="round" strokeLinejoin="round"/></svg></a></li>
        <li><a href="#" className="item current">1</a></li>
        <li><a href="#" className="item">2</a></li>
        <li><a href="#" className="item item-dots">...</a></li>
        <li><a href="#" className="item">8</a></li>
        <li><a href="#" className="item">9</a></li>
        <li><a href="#" className="item item-next" onClick={ () => nextPage() } ><svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M6 13L11 8L6 3" stroke="black" strokeWidth="1.6" strokeLinecap="round" strokeLinejoin="round"/></svg></a></li>
      </ul>
    </div>
	);
}

export default Pagination;
